/** @format */

import React, { Fragment, useState, useEffect, useCallback } from "react";
import {
  Typography,
  Button,
  Grid,
  Box,
  Checkbox,
  List,
  ListItem,
  ListItemButton,
  ListItemText,
  FormControlLabel,
} from "@mui/material";

import ClearIcon from "@mui/icons-material/Clear";
import { Get, DeleteById } from "../../utils/OperationCURD";

const CONFIG = {
  headers: {
    "Content-Type": "application/json",
    Accept: "application/json",
  },
};

const Classification = () => {
  const [classification, setClassification] = useState([]);
  const data = Get("classification");

  useEffect(() => {
    setClassification(data.data);
    console.log(classification);
  }, []);
  const clsHandler = (id) => {};
  return (
    <Fragment>
      <Button
        variant="contained"
        fullWidth
        sx={{
          borderRadius: "0.5rem",
        }}
      >
        + New Classification
      </Button>
      {classification.map((data) => (
        <Box mt={1}>
          <List>
            <ListItem disablePadding>
              <ListItemText>{data.name}</ListItemText>
              <Button
                variant="contained"
                onClick={clsHandler(data.id)}
                sx={{
                  borderRadius: "0.5rem",
                  float: "right",
                }}
              >
                <ClearIcon />
              </Button>
            </ListItem>
          </List>
        </Box>
      ))}
    </Fragment>
  );
};

export default Classification;
